	BulkFetchV31(context.Context, *listings.BulkListingRequestV31) (*listings.BulkListingResponseV31, error)
	// ORION:URL: POST
	BustListingCache(context.Context, *listings.BustListingCacheRequest) (*listings.BustListingCacheResponse, error)
