	GetListings(context.Context, *GetListingsRequest) (*GetListingsResponse, error)
	GetListingsCount(context.Context, *GetListingsCountRequest) (*GetListingsCountResponse, error)
	GetListingCountV2(context.Context, *GetListingCountV2Request) (*GetListingCountV2Response, error)
