	GetAttributes(context.Context, *GetAttributesRequest) (*GetAttributesResponse, error)
	GetMedia(context.Context, *GetMediaRequest) (*GetMediaResponse, error)
	InternalRepairListing(context.Context, *InternalRepairListingRequest) (*InternalRepairListingResponse, error)
	InternalRepairLike(context.Context, *InternalRepairLikeRequest) (*InternalRepairLikeResponse, error)
	// InternalDjCreateListing should _only_ be called by Django.
	InternalDjCreateListing(context.Context, *InternalDjCreateListingRequest) (*InternalDjCreateListingResponse, error)
