	InternalDjGetMedia(context.Context, *InternalDjGetMediaRequest) (*InternalDjGetMediaResponse, error)
	// InternalDjGetLikes should _only_ be called by Django.
	InternalDjGetLikes(context.Context, *InternalDjGetLikesRequest) (*InternalDjGetLikesResponse, error)
