	GetListingVideoUploadURL(context.Context, *GetListingVideoUploadURLRequest) (*GetListingVideoUploadURLResponse, error)
	// Endpoint for retrieving url used for uploading photos
	GetListingPhotoUploadURL(context.Context, *GetListingPhotoUploadURLRequest) (*GetListingPhotoUploadURLResponse, error)
	// Endpoint for bulk marking listings as listed, inactive, reserved, sold or deleted
	BulkUpdateStatus(context.Context, *BulkUpdateStatusRequest) (*BulkUpdateStatusResponse, error)
	// Endpoint for reindex existing listing to search ES
	IndexListing(context.Context, *IndexListingRequest) (*IndexListingResponse, error)
