	HasListingsInCategory(context.Context, *HasListingsInCategoryRequest) (*HasListingsInCategoryResponse, error)
	InternalUpdateListing(context.Context, *InternalUpdateListingRequest) (*InternalUpdateListingResponse, error)
	InternalUpdateMedia(context.Context, *InternalUpdateMediaRequest) (*InternalUpdateMediaResponse, error)
